CSS Trick 📜

You can create this cascading text effect with scroll-driven animations and custom properties 😎

h2 {
animation: reveal steps(1);
animation-timeline: --section;
animation-range: entry 100% exit calc(var(--i) * -5%);
}
@​keyframes reveal { 0% { scale: 0; } }

The trick here much like with many scroll animations is to leverage position: sticky 🍬

You stick an element containing the animated text within an element you use as the "scroller". Make sure to set the scroller bigger than the viewport so you have some scroll length to play with

.sticker { height: 100vh; }
.scroller { min-height: 200vh; }

This would give you 100vh of scroll for the animation to fit within 🤙

Now for the animation. You want to reveal each piece of text without a transition. You could do this in many ways including animating the scale with steps easing 🪜

@​keyframes reveal { 0% { scale: 0; } }
h2 { animation: reveal both steps(1, end); }

The last piece you need is the delay so they stagger in. Inline a custom property for the index of each block of text and you've got a way to control the delay 🙏

<h2 style="--i: 8;">Take a scroll.</h2>
<h2 style="--i: 7;">Take a scroll.</h2>
<h2 style="--i: 6;">Take a scroll.</h2>

The animation timeline is a view timeline connected to the scroller element (The parent of our sticky text container)

.scroller { view-timeline: --section; }

And putting it all together, you get:

.scroller { view-timeline: --section; }
h2 {
  animation: reveal both steps(1, end);
  animation-timeline: --section;
  animation-range: entry 100% exit calc(var(--i) * -5%);
}
@​keyframes reveal { 0% { scale: 0; }}

That's it! ✨ The rest of the styling is based on using text-stroke and leaning into the scoped custom property to define the opacity of the text stroke 🤓 Lastly, you can use line-height to control how tightly the text sits 🤏

The awesome thing here is, it's responsive. Adjust the line-heights, use clamp for the font, etc. and the animation will adjust 🙌

